  const update_info = async (update_Information) => {
    try {
      const result = await fetch("http://localhost:5000/Health-Website", {
        method: "POST",
        headers: {
          "content-type": "application/json",
          "Accept": "application/json"
        },
        body: JSON.stringify(update_Information),
      });
      const data = result.json();
    } catch (err) {
      console.log(err);
    }
  };
  const info = { name: "hello world" };
  return (
    <Router>
      <Routes>
        <Route path="/"  element = { 
            <div className="App">
              <Header />
              <Body />
            </div>
          }>
        </Route>
        <Route path="/Boards"></Route>
      </Routes>
    </Router>
  );
}

export default App;
